const partnersLength = partners.length; // get array length for fast execution of loop
const partnersLogo = document.querySelector('#logo-container');


for (let index = 0; index < partnersLength; index++) {

  const div = document.createElement('div');
  const anchor = document.createElement('a');
  const img = document.createElement('img');

  div.classList.add('p-logo');
  anchor.setAttribute('target','_blank');
  anchor.setAttribute('href',partners[index]['link']);
  img.setAttribute('src',partners[index]['img']);
  img.setAttribute('alt',partners[index]['name']);
  anchor.appendChild(img);
  div.appendChild(anchor);
  partnersLogo.appendChild(div);

}




